import React, { useState } from "react";
import { Link, useLocation, useNavigate } from "react-router-dom";
import { useAuth } from "../contexts/AuthContext";
import { motion } from "framer-motion";
import { Shield, Menu, X, Search, Bell, HelpCircle, Star } from "lucide-react";

const AuthButtons = () => {
  const { isAuthenticated, user, logout } = useAuth();
  const navigate = useNavigate();
  const [isProfileOpen, setIsProfileOpen] = useState(false);

  const handleLogout = async () => {
    await logout();
    navigate("/");
  };

  const handleDashboardNavigation = () => {
    if (user?.role === 'ADMIN') {
      navigate('/admin-dashboard');
    } else {
      navigate('/dashboard');
    }
  };

  if (isAuthenticated) {
    return (
      <div className="flex items-center gap-3">
        <motion.button
          onClick={handleDashboardNavigation}
          whileHover={{ scale: 1.05, y: -1 }}
          whileTap={{ scale: 0.95 }}
          className="px-6 py-2.5 rounded-lg font-semibold transition-all duration-300 bg-gradient-to-r from-blue-600 to-blue-700 hover:from-blue-700 hover:to-blue-800 text-white shadow-md hover:shadow-lg"
        >
          Dashboard
        </motion.button>
        <div className="relative">
          <motion.button
            onClick={() => setIsProfileOpen(!isProfileOpen)}
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.9 }}
            className="h-10 w-10 rounded-full flex items-center justify-center text-white font-bold transition-all duration-300 bg-gradient-to-br from-blue-600 to-blue-700 shadow-md hover:shadow-lg border-2 border-white/20"
          >
            {(user?.name || user?.email || 'U').charAt(0).toUpperCase()}
          </motion.button>
          
          {isProfileOpen && (
            <>
              <div className="fixed inset-0 z-10" onClick={() => setIsProfileOpen(false)} />
              <div className="absolute right-0 mt-2 w-64 bg-white rounded-xl shadow-xl border border-gray-100 z-20 overflow-hidden">
                <div className="p-4 border-b border-gray-100 bg-gradient-to-r from-blue-50 to-indigo-50">
                  <p className="font-bold text-gray-800">{user?.name || 'User'}</p>
                  <p className="text-sm text-gray-600">{user?.email}</p>
                  <div className="flex items-center gap-2 mt-2">
                    <span className="text-xs bg-blue-100 text-blue-700 px-2 py-1 rounded-full font-medium">{user?.role || 'USER'}</span>
                    <span className="text-xs bg-green-100 text-green-700 px-2 py-1 rounded-full font-medium">Active</span>
                  </div>
                </div>
                <div className="p-2">
                  <button
                    onClick={() => {
                      handleLogout();
                      setIsProfileOpen(false);
                    }}
                    className="w-full text-left px-4 py-3 text-sm text-red-600 hover:bg-red-50 transition-colors font-medium flex items-center gap-2"
                  >
                    <svg className="w-4 h-4" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                      <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17 16l4-4m0 0l-4-4m4 4H7m6 4v1a3 3 0 01-3 3H6a3 3 0 01-3-3V7a3 3 0 013-3h4a3 3 0 013 3v1" />
                    </svg>
                    Logout
                  </button>
                </div>
              </div>
            </>
          )}
        </div>
      </div>
    );
  }

  return (
    <div className="flex gap-3">
      <Link
        to="/login"
        className="px-6 py-2 text-gray-600 font-medium hover:text-gray-800 transition-colors"
      >
        Login
      </Link>
      <Link
        to="/register"
        className="px-6 py-2 rounded-lg font-medium transition-all duration-300"
        style={{
          backgroundColor: '#0061FF',
          color: 'white'
        }}
        onMouseEnter={(e) => {
          e.target.style.backgroundColor = '#0052E0';
        }}
        onMouseLeave={(e) => {
          e.target.style.backgroundColor = '#0061FF';
        }}
      >
        Get Started
      </Link>
    </div>
  );
};

export default function Navbar() {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isSearchOpen, setIsSearchOpen] = useState(false);
  const { isAuthenticated } = useAuth();

  return (
    <header className="fixed w-full top-0 z-50 bg-white/95 backdrop-blur-md border-b border-gray-100 shadow-sm">
      <nav className="max-w-7xl mx-auto px-6 py-3 flex justify-between items-center">
        <Link to="/" className="flex items-center gap-3 group">
          <motion.div
            whileHover={{ rotate: 360, scale: 1.1 }}
            transition={{ duration: 0.6, ease: "easeInOut" }}
            className="p-2 rounded-xl bg-gradient-to-br from-blue-600 to-blue-700 shadow-lg"
          >
            <Shield className="w-7 h-7 text-white" />
          </motion.div>
          <div className="flex flex-col">
            <span className="text-2xl font-black tracking-tight text-gray-900" style={{fontFamily: 'Inter, sans-serif'}}>SecureVault</span>
            <span className="text-xs text-blue-600 font-medium -mt-1">Document Security</span>
          </div>
        </Link>

        {/* Navigation Menu */}
        <div className="hidden lg:flex items-center gap-8">
          <div className="flex items-center gap-6">
            <motion.div whileHover={{ y: -2 }} className="relative group">
              <Link to="/" className="flex items-center gap-2 px-4 py-2 rounded-lg text-gray-700 hover:text-blue-600 transition-all duration-300 font-medium">
                <svg className="w-4 h-4" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 12l2-2m0 0l7-7 7 7M5 10v10a1 1 0 001 1h3m10-11l2 2m-2-2v10a1 1 0 01-1 1h-3m-6 0a1 1 0 001-1v-4a1 1 0 011-1h2a1 1 0 011 1v4a1 1 0 001 1m-6 0h6" />
                </svg>
                Home
              </Link>
              <div className="absolute bottom-0 left-0 w-0 h-0.5 bg-blue-600 group-hover:w-full transition-all duration-300" />
            </motion.div>
            
            <motion.div whileHover={{ y: -2 }} className="relative group">
              <button className="flex items-center gap-2 px-4 py-2 rounded-lg text-gray-700 hover:text-blue-600 transition-all duration-300 font-medium">
                <Shield className="w-4 h-4" />
                Features
              </button>
              <div className="absolute bottom-0 left-0 w-0 h-0.5 bg-blue-600 group-hover:w-full transition-all duration-300" />
            </motion.div>
            
            <motion.div whileHover={{ y: -2 }} className="relative group">
              <button className="flex items-center gap-2 px-4 py-2 rounded-lg text-gray-700 hover:text-blue-600 transition-all duration-300 font-medium">
                <HelpCircle className="w-4 h-4" />
                Support
              </button>
              <div className="absolute bottom-0 left-0 w-0 h-0.5 bg-blue-600 group-hover:w-full transition-all duration-300" />
            </motion.div>
          </div>
          
          {/* Search and Actions */}
          <div className="flex items-center gap-4">
            <motion.button
              whileHover={{ scale: 1.1 }}
              whileTap={{ scale: 0.9 }}
              onClick={() => setIsSearchOpen(!isSearchOpen)}
              className="p-2 rounded-lg text-gray-600 hover:text-blue-600 hover:bg-blue-50 transition-all duration-300"
            >
              <Search className="w-5 h-5" />
            </motion.button>
            
            {isAuthenticated && (
              <motion.button
                whileHover={{ scale: 1.1 }}
                whileTap={{ scale: 0.9 }}
                className="p-2 rounded-lg text-gray-600 hover:text-blue-600 hover:bg-blue-50 transition-all duration-300 relative"
              >
                <Bell className="w-5 h-5" />
                <span className="absolute -top-1 -right-1 w-3 h-3 bg-red-500 rounded-full flex items-center justify-center">
                  <span className="w-1.5 h-1.5 bg-white rounded-full" />
                </span>
              </motion.button>
            )}
            
            <div className="flex items-center gap-2 px-3 py-1 bg-yellow-50 border border-yellow-200 rounded-full">
              <Star className="w-4 h-4 text-yellow-500 fill-current" />
              <span className="text-sm font-medium text-yellow-700">Pro</span>
            </div>
          </div>
          
          <AuthButtons />
        </div>
        
        {/* Search Bar */}
        {isSearchOpen && (
          <motion.div
            initial={{ opacity: 0, y: -10 }}
            animate={{ opacity: 1, y: 0 }}
            className="absolute top-full left-0 right-0 bg-white border-b border-gray-100 p-4 shadow-lg"
          >
            <div className="max-w-7xl mx-auto">
              <div className="relative">
                <Search className="absolute left-3 top-1/2 transform -translate-y-1/2 w-5 h-5 text-gray-400" />
                <input
                  type="text"
                  placeholder="Search documents, features, help..."
                  className="w-full pl-10 pr-4 py-3 border border-gray-200 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                  autoFocus
                />
              </div>
            </div>
          </motion.div>
        )}

        <div className="lg:hidden flex items-center gap-3">
          <motion.button
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.9 }}
            onClick={() => setIsSearchOpen(!isSearchOpen)}
            className="p-2 rounded-lg text-gray-600 hover:text-blue-600 transition-colors"
          >
            <Search className="w-5 h-5" />
          </motion.button>
          
          <motion.button
            whileHover={{ scale: 1.1 }}
            whileTap={{ scale: 0.9 }}
            onClick={() => setIsMenuOpen(!isMenuOpen)}
            className="p-2 rounded-lg text-gray-700 hover:text-blue-600 transition-colors"
          >
            {isMenuOpen ? <X className="w-6 h-6" /> : <Menu className="w-6 h-6" />}
          </motion.button>
        </div>
      </nav>

      {isMenuOpen && (
        <motion.div
          initial={{ opacity: 0, y: -10 }}
          animate={{ opacity: 1, y: 0 }}
          className="lg:hidden absolute top-full left-0 right-0 bg-white shadow-xl border-b border-gray-100 z-40"
        >
          <div className="p-6 space-y-4">
            <div className="space-y-3">
              <Link to="/" className="flex items-center gap-3 p-3 rounded-lg hover:bg-gray-50 transition-colors" onClick={() => setIsMenuOpen(false)}>
                <svg className="w-5 h-5 text-blue-600" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 12l2-2m0 0l7-7 7 7M5 10v10a1 1 0 001 1h3m10-11l2 2m-2-2v10a1 1 0 01-1 1h-3m-6 0a1 1 0 001-1v-4a1 1 0 011-1h2a1 1 0 011 1v4a1 1 0 001 1m-6 0h6" />
                </svg>
                <span className="font-medium text-gray-700">Home</span>
              </Link>
              
              <button className="flex items-center gap-3 p-3 rounded-lg hover:bg-gray-50 transition-colors w-full text-left">
                <Shield className="w-5 h-5 text-blue-600" />
                <span className="font-medium text-gray-700">Features</span>
              </button>
              
              <button className="flex items-center gap-3 p-3 rounded-lg hover:bg-gray-50 transition-colors w-full text-left">
                <HelpCircle className="w-5 h-5 text-blue-600" />
                <span className="font-medium text-gray-700">Support</span>
              </button>
            </div>
            
            <div className="border-t border-gray-100 pt-4">
              <AuthButtons />
            </div>
          </div>
        </motion.div>
      )}
    </header>
  );
}
